import React from 'react';
import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';

export default function VisualizationRenderer({ response }) {
  if (!response) return null;

  const { type, data } = response;

  if (!type || !data) {
    return (
      <div style={{ 
        color: 'red', 
        padding: '10px',
        margin: '10px 0',
        border: '1px solid #ffcccc'
      }}>
        Invalid response format
      </div>
    );
  }

  switch (type) {
    case 'string':
      return (
        <div style={{ 
          whiteSpace: 'pre-wrap', 
          padding: '15px', 
          margin: '10px 0',
          backgroundColor: '#f8f9fa',
          border: '1px solid #eee',
          borderRadius: '4px'
        }}>
          {data}
        </div>
      );

    case 'table':
      if (!Array.isArray(data)) {
        return (
          <div style={{ color: 'red' }}>
            Table data must be an array
          </div>
        );
      }

      const headers = data.length > 0 
        ? [...new Set(data.flatMap(item => Object.keys(item)))]
        : [];

      return (
        <div style={{ 
          overflowX: 'auto', 
          margin: '20px 0',
          boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
        }}>
          <table style={{ 
            width: '100%', 
            borderCollapse: 'collapse',
            fontSize: '0.9rem'
          }}>
            <thead>
              <tr style={{ 
                backgroundColor: '#f5f5f5',
                textAlign: 'left'
              }}>
                {headers.map((header) => (
                  <th 
                    key={header} 
                    style={{ 
                      padding: '12px 15px', 
                      border: '1px solid #ddd',
                      fontWeight: 'bold'
                    }}
                  >
                    {header}
                  </th>
                ))}
              </tr>
            </thead>
            <tbody>
              {data.map((row, idx) => (
                <tr 
                  key={idx} 
                  style={{ 
                    borderBottom: '1px solid #ddd',
                    '&:hover': {
                      backgroundColor: '#f9f9f9'
                    }
                  }}
                >
                  {headers.map((header) => (
                    <td 
                      key={`${idx}-${header}`} 
                      style={{ 
                        padding: '12px 15px', 
                        border: '1px solid #ddd'
                      }}
                    >
                      {row[header] ?? 'N/A'}
                    </td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      );

    case 'pie':
    case 'bar':
      if (!Array.isArray(data) || !data.every(item => item.name && item.value)) {
        return (
          <div style={{ color: 'red' }}>
            Invalid chart data format
          </div>
        );
      }

      const chartOptions = {
        chart: { type },
        title: { text: type === 'pie' ? 'Distribution' : 'Bar Chart' },
        series: [{
          name: 'Value',
          data: data.map(d => ({ 
            name: d.name, 
            y: typeof d.value === 'string' ? parseFloat(d.value) : d.value 
          })),
        }],
        plotOptions: {
          pie: {
            allowPointSelect: true,
            cursor: 'pointer',
            dataLabels: {
              enabled: true,
              format: '<b>{point.name}</b>: {point.percentage:.1f} %'
            }
          },
          bar: {
            colorByPoint: true
          }
        },
        xAxis: type === 'bar' ? {
          type: 'category',
          title: { text: 'Category' }
        } : undefined,
        yAxis: {
          title: { text: 'Value' }
        }
      };

      return (
        <div style={{ margin: '20px 0' }}>
          <HighchartsReact 
            highcharts={Highcharts} 
            options={chartOptions} 
          />
        </div>
      );

    case 'timeseries':
      if (!Array.isArray(data) || !data.every(item => item.date && item.value)) {
        return (
          <div style={{ color: 'red' }}>
            Invalid timeseries data format
          </div>
        );
      }

      const timeSeriesOptions = {
        chart: { type: 'line' },
        title: { text: 'Time Series' },
        xAxis: {
          type: 'datetime',
          title: { text: 'Date' }
        },
        yAxis: {
          title: { text: 'Value' }
        },
        series: [{
          name: 'Value',
          data: data.map(d => ({
            x: new Date(d.date).getTime(),
            y: typeof d.value === 'string' ? parseFloat(d.value) : d.value,
            name: d.date
          }))
        }],
        tooltip: {
          formatter: function() {
            return `<b>${Highcharts.dateFormat('%Y-%m-%d', this.x)}</b><br/>Value: ${this.y}`;
          }
        }
      };

      return (
        <div style={{ margin: '20px 0' }}>
          <HighchartsReact 
            highcharts={Highcharts} 
            options={timeSeriesOptions} 
          />
        </div>
      );

    default:
      return (
        <div style={{ 
          color: 'orange', 
          padding: '10px',
          margin: '10px 0',
          border: '1px solid #ffeeba'
        }}>
          Unsupported visualization type: {type}
        </div>
      );
  }
}
